import React, { Fragment } from "react";
import { Content } from "../Components/Content";
import { Card } from "react-bootstrap";
function LecturerDashboard() {
    return (
        <Fragment>
            <Content>
                <div id="lecturerDashboard" style={{padding: "2rem"}}>
                    <Card className="cardDashboard" style={{ width: "20%", maxWidth: "240px" }}>
                        <Card.Body>
                            <Card.Title>
                                <i className={'fa-regular fa-bookmark'} id={'bookmarkIcon'}></i>
                            </Card.Title>
                            <p>Courses</p>
                            <p>13</p>
                        </Card.Body>
                    </Card>
                </div>
            </Content>
        </Fragment>
    );
}
export default LecturerDashboard;
